(function($) {
    "use strict"
    $(function() {

        var colors = [
            'data:image/png;base64,',
            'data:image/png;base64,',
            'data:image/png;base64,',
            'data:image/png;base64,',
        ]
        
        var current = 0
        
        $('.in-td__left__img img').attr('src', colors[current]);

        $('.in-td__left__inner .btn.is--ch').on('click', function(e) {
            e.preventDefault()
            if(current <= colors.length - 2) {
                current++
            }else {
                current = 0
            }
            $('.in-td__left__img img').attr('src', colors[current]);
        })

    })
})(jQuery);